transforms.result:
.paper {
  position: relative;
  display: flex;
  margin-bottom: 60px;
  padding: var(--mantine-spacing-xl) var(--mantine-spacing-md);

  @mixin data-color 1;

  @mixin larger-than 998px {
    padding: calc(var(--mantine-spacing-3xl) + var(--mantine-spacing-xxs) * 2) var(--mantine-spacing-3xl);
    min-height: 336px;
  }
}

.title {
  display: flex;
  align-items: center;
  margin-bottom: var(--mantine-spacing-md);
  font-size: 20px;
  line-height: 23px;
  gap: var(--mantine-spacing-xs);
  text-wrap: balance;

  .emoji {
    width: 24px;
    height: 24px;

    @mixin larger-than 998px {
      width: 32px;
      height: 32px;
    }
  }

  @mixin larger-than 998px {
    margin-bottom: var(--mantine-spacing-lg);
    font-size: 32px;
    line-height: 37px;
  }
}

.description {
  font-size: 16px;
  line-height: 18px;

  &:not(:last-child) {
    margin-bottom: var(--mantine-spacing-md);
  }

  @mixin larger-than 998px {
    max-width: 872px;
    font-size: 22px;
    line-height: 25px;
  }
}

.image {
  display: none;
  object-fit: contain;

  @mixin larger-than 1200px {
    position: absolute;
    right: 60px;
    display: block;
  }
}

